import "./Register.css";
import logo from "../../images/registerLogo.svg";

function Register() {
    return (
      <div className="register">
          <div className="register__header">
              <img />
              <p>Добро пожаловать!</p>
          </div>
      </div>
    );
  }
  
  export default Register;
